import React, { Component } from 'react';

class Points extends Component {
    state = {
        names: []
    }

    componentDidMount() {
        console.log("mounting")
        var arrayNames = document.cookie.substring(document.cookie.indexOf(";")+2).split("|");
        var namesAndPoints = {};
        arrayNames.map((n, index, arr) => {
            if (!(index == arr.length-1)) {
                console.log(n);
                namesAndPoints.push({
                    name: n,
                    points: 0
                })
            }

        })
        console.log(namesAndPoints);
        console.log("finished mounting")
    }
    render() {
        const { names } = this.state
        return (
            <div> {
                names.map((n, index, arr) => {
                    if (!(index == arr.length-1))
                    {return <div id = {n}> {n} </div>}
                })
            } </div>
        )
    }
}

export default Points;
